dynamic _parseFilterValue(
  Object? value,
  List<dynamic> args,
  Map<String, dynamic> namedArgs,
  dynamic Function(Object?) parser,
) {
  if (namedArgs.isNotEmpty) {
    final parsed = parser(namedArgs);
    if (parsed != null) {
      return parsed;
    }
    if (!namedArgs.containsKey('constructor') &&
        !namedArgs.containsKey('type')) {
      final wrapped = <String, dynamic>{'constructor': 'new'};
      wrapped.addAll(namedArgs);
      final fallback = parser(wrapped);
      if (fallback != null) {
        return fallback;
      }
    }
  }
  if (value != null) {
    return parser(value);
  }
  if (args.isNotEmpty) {
    return parser(args.first);
  }
  return null;
}
